import React, { useState, useEffect } from "react";
import WalletConnector from "./components/WalletConnector";

function App() {
  const [walletAddress, setWalletAddress] = useState(null);
  const [balance, setBalance] = useState(0);
  const [bet, setBet] = useState(1); // Початкова ставка для першого гравця
  const [bets, setBets] = useState([]);
  const [gameTimer, setGameTimer] = useState(null);
  const [isGameActive, setIsGameActive] = useState(false);

  // Підключення до гаманця при завантаженні
  useEffect(() => {
    if (window.pelagus) {
      window.pelagus.request({ method: 'quai_requestAccounts' })
        .then(accounts => {
          if (accounts && accounts.length > 0) {
            setWalletAddress(accounts[0]);
            fetchBalance(accounts[0]);
          }
        });
    }
  }, []);

  // Отримання балансу гаманця
  const fetchBalance = async (address) => {
    try {
      const balance = await window.pelagus.request({
        method: 'quai_getBalance',
        params: [address]
      });
      setBalance(balance);
    } catch (error) {
      console.error('Error fetching balance:', error);
    }
  };

  // Функція для надсилання ставки
  const placeBet = async () => {
    if (!walletAddress) {
      alert('Будь ласка, підключіть гаманець!');
      return;
    }

    try {
      const transaction = await window.pelagus.request({
        method: 'quai_sendTransaction',
        params: [{
          from: walletAddress,
          to: "0x000c3877DE5ae7B74b2dd8afD54B306D9c43fD80",  // Адреса контракту або дистрибуції
          value: window.pelagus.utils.toHex(bet * 1e18), // Перетворення на wei
          gas: "0x5208", // 21000 gas
        }],
      });

      // Якщо транзакція успішна, оновлюємо список ставок
      setBets([...bets, { address: walletAddress, amount: bet, time: new Date() }]);
      setIsGameActive(true);
      setGameTimer(Date.now() + 60 * 60 * 1000);  // Таймер на годину

      setBet(prevBet => prevBet + 1); // Збільшення ставки для наступного гравця
    } catch (error) {
      console.error('Error placing bet:', error);
    }
  };

  // Підключення/відключення гаманця
  const handleConnectWallet = () => {
    if (walletAddress) {
      setWalletAddress(null);
      setBalance(0);
      setBets([]);
      setIsGameActive(false);
    } else {
      window.pelagus.request({ method: 'quai_requestAccounts' })
        .then(accounts => {
          if (accounts && accounts.length > 0) {
            setWalletAddress(accounts[0]);
            fetchBalance(accounts[0]);
          }
        });
    }
  };

  return (
    <div className="App">
      <header>
        <button onClick={handleConnectWallet}>
          {walletAddress ? `Підключено: ${walletAddress.substring(0, 6)}...${walletAddress.slice(-4)}` : 'Підключити гаманець'}
        </button>
        <p>Баланс: {balance} Quai</p>
      </header>

      <div className="game-container">
        <button onClick={placeBet} disabled={isGameActive}>
          {isGameActive ? 'Гра триває...' : `Поставити ${bet} Quai`}
        </button>

        <div className="bet-table">
          <h3>Ставки:</h3>
          <table>
            <thead>
              <tr>
                <th>Гравець</th>
                <th>Сума</th>
                <th>Час</th>
              </tr>
            </thead>
            <tbody>
              {bets.slice(0, 10).map((bet, index) => (
                <tr key={index}>
                  <td>{bet.address.substring(0, 6)}...{bet.address.slice(-4)}</td>
                  <td>{bet.amount} Quai</td>
                  <td>{Math.floor((Date.now() - new Date(bet.time)) / 60000)} хв.</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default App;
